(186, 'elementor_remote_info_feed_data', 'a:5:{i:0;a:5:{s:5:\"title\";s:34:\"Elementor Websites of January 2022\";s:7:\"excerpt\";s:235:\"Showcasing many of the trends we recently predicted for 2022, Januarys showcase offers an intriguing list of websites that weave together a journey that delights the eyes, warms the heart, sparks the imagination, and blows the mind.\";s:7:\"created\";i:1644798900;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:121:\"https://elementor.com/blog/showcase-january-2022/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:1;a:5:{s:5:\"title\";s:80:\"How Ongage Optimized Their Elementor-Based Website and Boosted Its Speed by 110%\";s:7:\"excerpt\";s:221:\"\"We wanted to make a pixel-perfect website that perfectly conveyed our brand\"  learn how Ongage, a full-stack email marketing platform, used Elementor to redesign their website and improve its performance dramatically.\";s:7:\"created\";i:1644321663;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:116:\"https://elementor.com/blog/ongage-casestudy/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:2;a:5:{s:5:\"title\";s:59:\"Expert Web Creators of the Month: One Form to Rule Them All\";s:7:\"excerpt\";s:156:\" We challenged you to create snazzy contact forms, enticing newsletter signups, and delightful multi-step experiences   see which web creators stood out.\";s:7:\"created\";i:1644219143;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:138:\"https://elementor.com/blog/expert-web-creators-of-the-month-forms/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:3;a:5:{s:5:\"title\";s:55:\"Capture Hearts and Sales With Our Valentines Day Kit\";s:7:\"excerpt\";s:185:\"Our new Valentine\'s Day Kit is full of wonderful landing pages, sections, popups, and vector assets to help you quickly get your website ready for the most romantic holiday of the year.\";s:7:\"created\";i:1642422001;s:5:\"badge\";s:0:\"\";s:3:\"url\";s:118:\"https://elementor.com/